import Orders from "./Orders";
import { useQuery } from "react-apollo";
import { GET_ORDERS } from "../queries/queries";

const GetOrders = () => {
  const tag = 'tag: delivery'

  // Apollo data
  const { data } = useQuery(GET_ORDERS, {
    pollInterval: 5000,
    variables: { tag }
  });

  console.log("Get Orders", data);

  return (
    <>
      <Orders data={data} />
    </>
  );
};

export default GetOrders;
